import ibanez from './../img/products/Ibanez.png'
import yamaha from './../../img/products/Yamaha.png'
import takamine from './../../img/products/Takamine1.png'
import belucci from './../../img/products/belucci1.png'
import Card from '../card/Card'

import './product.css'

const arr = [
    {
        "title": "IBANEZ GRX40-BKN", 
        "price": "25 399", 
        "imageUrl": ibanez,
        "category": "Электрогитара"
    },
    {
        "title": "YAMAHA F310 N", 
        "price": "20 999", 
        "imageUrl": yamaha, 
        "category": "Акустическая гитара"
    },
    {
        "title": "Belucci BC4010BK", 
        "price": "5 499", 
        "imageUrl": belucci, 
        "category": "Акустическая гитара"
    },
    {
        "title": "TAKAMINE G50 SERIES", 
        "price": "37 999", 
        "imageUrl": takamine, 
        "category": "Акустическая гитара"
    },
    
 ]


const Products = () => {
    
    return (
    <section className='Products'>
       
        <div className="container">
            
        <span>Популярные товары</span>


            <div className="tovary">
            { arr.map((obj) => ( 
                <Card 
                    title={obj.title}
                    price={obj.price}
                    category={obj.category}
                    imageUrl={obj.imageUrl} 
                    onClickAdd = {() => console.log('Добавлено в корзину')}
                />
            ))}
  
            </div>
    
        
        </div>
                
    </section>);
        
}
 


export default Products;
